#!/usr/bin/env python3

#read in sequence
dna = ''
dna_set = set(dna)
print(dna_set)

#make a for loop that counts unique characters in sequence
nt_counts = {}
for nt in dna_set:
    count = dna.count(nt)
    nt_counts[nt] = count
print(f'counts: {nt_counts}')

#get GC content
sum_nts = len(dna)
gc_cont = (int(nt_counts['G'])+int(nt_counts['C']))/sum_nts

print(f'GC content: {gc_cont:.2%}')